# Graficamente
def plot_coefficients(cdf, technique=None):
  fig, ax = plt.subplots(figsize=(20, 8))
  ax.stem(cdf.index, cdf['Coefficients'], markerfmt=' ')
  ax.set_xlabel('variable')
  ax.set_ylabel('coefficients')
  ax.set_title(technique);
  plt.xticks(rotation=45, fontsize=14)
  plt.show()

"""**Nota**: Dadas las diferencias de escala entre las distintas variables, probablemente convenga hacer primero una normalizacin o estandarizacin de las mismas."""

